<p class="Section amending"><strong><a class="sectionLabel" id="s-91"><span class="sectionLabel">91</span></a></strong> The Description of Goods of tariff item No. 4011.90.10 in the List of Tariff Provisions set out in the schedule to the English version of the Act is amended by replacing the reference to “Of a size of 3,600 x 51 or 4,000 x 57” with a reference to “Of a size of 3600 X 51 or 4000 X 57”.</p>
